{"cells":[{"source":"<a href=\"https://www.kaggle.com/code/kemenwong/case-study-1-divvy-bikeshare?scriptVersionId=106521556\" target=\"_blank\"><img align=\"left\" alt=\"Kaggle\" title=\"Open in Kaggle\" src=\"https://kaggle.com/static/images/open-in-kaggle.svg\"></a>","metadata":{},"cell_type":"markdown","outputs":[],"execution_count":0},{"cell_type":"markdown","id":"9b75e918","metadata":{"papermill":{"duration":0.011796,"end_time":"2022-09-26T00:45:17.96741","exception":false,"start_time":"2022-09-26T00:45:17.955614","status":"completed"},"tags":[]},"source":["# Case Study: How does a bike-share navigate speedy success?\n"]},{"cell_type":"markdown","id":"76775bd5","metadata":{"papermill":{"duration":0.009872,"end_time":"2022-09-26T00:45:17.989506","exception":false,"start_time":"2022-09-26T00:45:17.979634","status":"completed"},"tags":[]},"source":["## Scenario\n","\n","As a junior data analyst, we are working with the marketing analyst team at Cyclistic. The task is to understand the key differences between how casual riders and annual members use Cyclistic bikes. With those insights, we will design a new marketing strategy to convert casual riders into annual members."]},{"cell_type":"markdown","id":"041e2f8b","metadata":{"papermill":{"duration":0.009714,"end_time":"2022-09-26T00:45:18.00943","exception":false,"start_time":"2022-09-26T00:45:17.999716","status":"completed"},"tags":[]},"source":["## Background\n","\n","Cyclistic is a bike-share service in Chicago that was successfully launched in 2016 and now features more than 5800 bicycles and 600 docking stations. Along with standard two-wheeled bikes, the company also offers assistive options for bikers with disabilities such as reclining bikes and cargo bikes. Roughly 8% of bikers use the assistive option, and only 30% of bikers use this service to commute to work each day.\n","\n","We are a part of the marketing analytics team responsible for collecting, analyzing, and reporting data related to all marketing campaigns and initiatives for the bike-share program. The director of marketing and our direct manager is Lily Moreno, who oversees all the team's activities. The primary audience will be the Cyclistic executive team, who will review and approve our recommended marketing programs for the company.\n","\n","The current marketing strategy is to build upon general awareness and appeal to broad consumer segments. One successful approach was to offer flexibility in pricing plans: single-ride or full-day ride passes, and annual memberships. We classify customers with single-ride or full-day ride passes as casual riders and customers with annual memberships as annual members. \n","\n","The finance analysts have concluded that having annual members are much more profitable than having casual riders. Moreno believes maximizing annual members is the key to company growth so she suggests creating a marketing campaign that targets casual riders and converts them into annual members. In order to create this strategy, it is important for us to understand the following: what differs between casual riders and annual members, what prompts casual riders to purchase an annual membership, and how digital media affect our marketing efforts."]},{"cell_type":"markdown","id":"d695aa94","metadata":{"papermill":{"duration":0.010153,"end_time":"2022-09-26T00:45:18.029403","exception":false,"start_time":"2022-09-26T00:45:18.01925","status":"completed"},"tags":[]},"source":["## Checklist\n","\n","Moreno has assigned us the first question: How do casual riders and annual members use Cyclistic bikes differently? \n","\n","We will produce a report with the following deliverables:\n","* a clear statement of the business task\n","* a description of all data sources\n","* documentation of any cleaning or manipulation of data\n","* summary of analysis\n","* supporting visualizations and key findings\n","* top three recommendations based on the analysis\n","    \n"]},{"cell_type":"markdown","id":"a4a0381e","metadata":{"papermill":{"duration":0.00987,"end_time":"2022-09-26T00:45:18.049078","exception":false,"start_time":"2022-09-26T00:45:18.039208","status":"completed"},"tags":[]},"source":["## Ask Phase\n","\n","Guiding Questions\n","1. What is the problem you are trying to solve?\n","2. How can your insights drive business decisions?\n","\n","Key Tasks\n","1. Identify the business task\n","2. Consider the key stakeholders\n","\n","Based on financial analysis, profitability is driven by having customers purchase annual memberships as opposed to single-ride or full-day passes. Our main task at hand is to figure out what the key differences are between our casual riders and our annual members. The insights this provides will allow us to formulate a strategy targeting current casual riders and converting them into annual members. We expect this strategy to result in increased profitability and ultimately, future company growth."]},{"cell_type":"markdown","id":"98032317","metadata":{"papermill":{"duration":0.009725,"end_time":"2022-09-26T00:45:18.068409","exception":false,"start_time":"2022-09-26T00:45:18.058684","status":"completed"},"tags":[]},"source":["## Prepare Phase\n","\n","Guiding Questions\n","1. Where is your data located?\n","2. How is the data organized?\n","3. Are the issues with bias or credibility in this data? Does your data ROCCC?\n","4. How are you addressing licensing, privacy, security, and accessibility?\n","5. How did you verify the data's integrity?\n","6. How does it help you answer your question?\n","7. Are there any problems with the data?\n","\n","Key Tasks\n","1. Download data and store it appropriately\n","2. Identify how it is organized\n","3. Sort and filter the data\n","4. Determine the credibility of the data\n","\n","The data source used for this analysis comes from Lyft Bikes and Scooters, LLC (“Bikeshare”). The organization operates the Divvy bicycle sharing service located within the City of Chicago’s (“City”). Since Cyclistic is a fictitious company, we will be using data collected in the past twelve months by this organization as a basis to answer our business question [link] (https://divvy-tripdata.s3.amazonaws.com/index.html). This data is an appropriate representation of the customer data that would have been collected by a bikesharing service such as Cyclistic. Furthermore, the data has been made available for public use under the Divvy Data License Agreement [link] (https://ride.divvybikes.com/data-license-agreement).\n","\n","The data sets used contain historical trip information of all riders that have accessed the Divvy bikeshare service between May 2021 to April 2022. The data consists of the type of bike taken, the trip start and end times, the trip start and end stations, and the type of customer.  \n","\n","The datasets are organized into thirteen columns:<br>\n","**ride_id** - an unique identifier associated with a single ride from the moment the bike is checked out from the starting station to the moment it is checked into the ending station<br>\n","**rideable_type** - the type of bike that was borrowed and consists of three possible options: classic, docked, and electric<br>\n","**started_at** - the date and time (YYYY-MM-DD HH:MM:SS) that the bike was checked out<br>\n","**ended_at** - the date and time (YYYY-MM-DD HH:MM:SS) that the bike was checked in<br>\n","**start_station_name** - the specific station that the bike was checked out from<br>\n","**start_station_id** - the unique identifier given to each station<br>\n","**end_station_name** - denotes the specific station that the bike was checked into<br>\n","**end_station_id** - the unique identifier given to each station<br>\n","**start_lat** - the latitudinal coordinate associated with the starting station<br>\n","**start_lng** - the longitudinal coordinate associated with the starting station<br>\n","**end_lat** - the latitudinal coordinate associated with the ending station<br>\n","**end_lng** - the longitudinal coordinate associated with the ending station<br>\n","**member_casual** - the type of customer the rider is, either casual (single-ride or full-day passes) or member (annual memberships)\n","\n","\n","Based on the ROCCC system, there are no issues with the integrity or credibility of the data used. The data is reliable since it includes the processed information pertaining to each recorded ride that occurred within the past year, within the area of service. It has taken to account any rides that were taken by staff and any potentially false trips (false starts, re-docking bikes, etc.). The data is original since it is collected first-hand by Lyft Bikes and Scooters, LLC (“Bikeshare”). The data is  comprehensive in the scoop of the analysis but it is important to note that certain data such as personal identifiable information has been removed during anonymization as per privacy standards. This would lead to certain limitations within our analysis such as not being able to determine if customers reside within the area of service or account for casual customers purchasing multiple single-ride passes. The data is current as all datasets used within this analysis were from the past twelve months (May 2021 to April 2022). The data is credible since the Divvy system data in question is owned by the City of Chicago, which has reviewed and authorized the publication of its data for public use under its License Agreement. \n","\n","After assessing the licensing agreement, we are permitted to access, modify, and analyze the data as long as our use complies with the terms and conditions outlined within the document. The data was chosen because it can help us identify trends and relationships within and across the casual and member customer groups that use the bikeshare service. Insights regarding trip duration and frequencies could provide an explanation as to why customers remain casual riders and what could prompt them to become annual members. "]},{"cell_type":"markdown","id":"09708496","metadata":{"papermill":{"duration":0.009617,"end_time":"2022-09-26T00:45:18.087693","exception":false,"start_time":"2022-09-26T00:45:18.078076","status":"completed"},"tags":[]},"source":["## Process Phase\n","\n","Guiding Questions\n","1. What tools are you choosing and why?\n","2. Have you ensured your data's integrity?\n","3. What steps have you taken to ensure that your data is clean?\n","4. How can you verify that your data is clean and ready to analyze?\n","5. Have you documented your cleaning process so you can review and share those results?\n","\n","Key Tasks\n","1. Check the data for errors\n","2. Choose your tools\n","3. Transform the data so you can work with it effectively\n","4. Document the cleaning process\n","\n","RStudio Desktop was the main tool I used to clean and modify the data to ensure that it would be ready for analysis. The reason why I chose to use a programming language over spreadsheet software was because of the large quantity of data stored within these public data sets. \n","\n","In order to ensure the integrity of the data, I first installed and loaded the appropriate R packages into my workspace to ensure I had the proper functions to work with large data sets containing date-time data types."]},{"cell_type":"code","execution_count":1,"id":"5e5083c9","metadata":{"execution":{"iopub.execute_input":"2022-09-26T00:45:18.110699Z","iopub.status.busy":"2022-09-26T00:45:18.108607Z","iopub.status.idle":"2022-09-26T00:47:21.529764Z","shell.execute_reply":"2022-09-26T00:47:21.527998Z"},"papermill":{"duration":123.435471,"end_time":"2022-09-26T00:47:21.532684","exception":false,"start_time":"2022-09-26T00:45:18.097213","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unspecified)\n","\n","also installing the dependency ‘reprex’\n","\n","\n","Installing package into ‘/usr/local/lib/R/site-library’\n","(as ‘lib’ is unsp