om. In this step, only the columns of interest were included (ride_id, rideable_type, started_at, ended_at, member_casual). "]},{"cell_type":"code","execution_count":2,"id":"64091b85","metadata":{"execution":{"iopub.execute_input":"2022-09-26T00:47:21.609594Z","iopub.status.busy":"2022-09-26T00:47:21.580073Z","iopub.status.idle":"2022-09-26T00:47:44.167793Z","shell.execute_reply":"2022-09-26T00:47:44.165914Z"},"papermill":{"duration":22.603846,"end_time":"2022-09-26T00:47:44.171063","exception":false,"start_time":"2022-09-26T00:47:21.567217","status":"completed"},"tags":[]},"outputs":[],"source":["X202105_divvy_tripdata <- read_csv(\"../input/divvy-trip-data/202105-divvy-tripdata.csv\", \n","                                   col_types = cols(ride_id = col_character(), \n","                                                    rideable_type = col_character(), \n","                                                    started_at = col_datetime(format = \"%Y-%m-%d %H:%M:%S\"), \n","                                                    ended_at = col_datetime(format = \"%Y-%m-%d %H:%M:%S\"), \n","                                                    start_station_name = col_skip(), \n","                                                    start_station_id = col_skip(), end_station_name = col_skip(), \n","                                                    end_station_id = col_skip(), start_lat = col_skip(), \n","                                                    start_lng = col_skip(), end_lat = col_skip(), \n","                                                    end_lng = col_skip(), member_casual = col_character()))\n","\n","\n","X202106_divvy_tripdata <- read_csv(\"../input/divvy-trip-data/202106-divvy-tripdata.csv\", \n","                                   col_types = cols(ride_id = col_character(), \n","                                                    rideable_type = col_character(), \n","                                                    started_at = col_datetime(for