ll_type":"code","execution_count":10,"id":"3ca58af6","metadata":{"execution":{"iopub.execute_input":"2022-09-26T00:48:50.961267Z","iopub.status.busy":"2022-09-26T00:48:50.959751Z","iopub.status.idle":"2022-09-26T00:48:51.99364Z","shell.execute_reply":"2022-09-26T00:48:51.991803Z"},"papermill":{"duration":1.053819,"end_time":"2022-09-26T00:48:51.99582","exception":false,"start_time":"2022-09-26T00:48:50.942001","status":"completed"},"tags":[]},"outputs":[],"source":["monthly_total_trip_duration <- complete_divvy_tripdata %>%\n","  group_by(month = lubridate::floor_date(started_at, \"month\")) %>%\n","  summarize(total_trip_duration = sum(trip_duration))\n","\n","view(monthly_total_trip_duration)"]},{"cell_type":"markdown","id":"b4107c1b","metadata":{"papermill":{"duration":0.016323,"end_time":"2022-09-26T00:48:52.028491","exception":false,"start_time":"2022-09-26T00:48:52.012168","status":"completed"},"tags":[]},"source":["From the resulting table, we notice that there is a greater total trip duration (in mins) in the summer months which becomes much lower during the winter season. We create a visualization of this to get a better understanding of just how drastic the change was. In order to do so, we appropriately convert the month variable from a date time data type to a date data type. Furthermore, we divide the total trip duration (in mins) by a million to get a better fit of values for the y-axis on the graph."]},{"cell_type":"code","execution_count":11,"id":"98754898","metadata":{"execution":{"iopub.execute_input":"2022-09-26T00:48:52.063719Z","iopub.status.busy":"2022-09-26T00:48:52.062161Z","iopub.status.idle":"2022-09-26T00:48:52.532235Z","shell.execute_reply":"2022-09-26T00:48:52.530414Z"},"papermill":{"duration":0.49001,"end_time":"2022-09-26T00:48:52.534479","exception":false,"start_time":"2022-09-26T00:48:52.044469","status":"completed"},"tags":[]},"outputs":[{"data":{"image/png":"iVBORw0KGgoAAAANSUhEUgAAA0gAAANICAIAAAByhViMAAAABmJLR0QA/wD/AP+gvaeTAAAg\n