 riders and annual members, we add an additional condition in the function to group by the member_casual variable."]},{"cell_type":"code","execution_count":12,"id":"8040ca14","metadata":{"execution":{"iopub.execute_input":"2022-09-26T00:48:52.608464Z","iopub.status.busy":"2022-09-26T00:48:52.606874Z","iopub.status.idle":"2022-09-26T00:48:54.311951Z","shell.execute_reply":"2022-09-26T00:48:54.310118Z"},"papermill":{"duration":1.726835,"end_time":"2022-09-26T00:48:54.314377","exception":false,"start_time":"2022-09-26T00:48:52.587542","status":"completed"},"tags":[]},"outputs":[{"name":"stderr","output_type":"stream","text":["\u001b[1m\u001b[22m`summarise()` has grouped output by 'month'. You can override using the\n","`.groups` argument.\n"]}],"source":["monthly_total_trip_duration <- complete_divvy_tripdata %>%\n","  group_by(month = lubridate::floor_date(started_at, \"month\"), member_casual) %>%\n","  summarize(total_trip_duration = sum(trip_duration))\n","\n","view(monthly_total_trip_duration)"]},{"cell_type":"markdown","id":"8c66e5ff","metadata":{"papermill":{"duration":0.02337,"end_time":"2022-09-26T00:48:54.355591","exception":false,"start_time":"2022-09-26T00:48:54.332221","status":"completed"},"tags":[]},"source":["From the resulting table, we notice that the total trip duration for casual riders is much more variable than for annual members as there was less consistency seen throughout the year. We create a visualization of this to get a better understanding of just how different the trend is between casual riders and annual members. Again, we appropriately convert the month variable from a date time data type to a date data type and divide the total trip duration (in mins) by a million."]},{"cell_type":"code","execution_count":13,"id":"dce02670","metadata":{"execution":{"iopub.execute_input":"2022-09-26T00:48:54.393852Z","iopub.status.busy":"2022-09-26T00:48:54.392268Z","iopub.status.idle":"2022-09-26T00:48:54.81045Z","shell.execute_reply":"2022-09-26T00:48