"completed"},"tags":[]},"source":["Overall, our analysis of the distribution of riders throughout the week for the months of May, June, and July showed that there is a stark trend for casual riders but not for annual members. We see higher numbers of ridership during the weekend for casual riders which is an important distinction from annual members who are less influenced by day of the week if any. "]},{"cell_type":"markdown","id":"8a6ea710","metadata":{"papermill":{"duration":0.034618,"end_time":"2022-09-26T00:49:05.664412","exception":false,"start_time":"2022-09-26T00:49:05.629794","status":"completed"},"tags":[]},"source":["## Act Phase\n","\n","Guiding Questions\n","1. What is the final conclusion based on your analysis?\n","2. How could your team and business apply your insights?\n","3. What next steps would you or your stakeholders take based on your findings?\n","4. Is there additional data you could use to expand on your findings?\n","\n","Key Tasks\n","1. Create your portfolio\n","2. Add your case study\n","3. Practice presenting your case study"]},{"cell_type":"markdown","id":"6314d5dc","metadata":{"papermill":{"duration":0.034936,"end_time":"2022-09-26T00:49:05.73392","exception":false,"start_time":"2022-09-26T00:49:05.698984","status":"completed"},"tags":[]},"source":["Based on the analysis conducted, we can conclude that casual riders are using the bikeshare service for longer rider durations on average compared to annual members. This is most apparent during the months of May to September which we hypothesized was due to the preferable outdoor weather conditions during this period of time. Finally, we saw a stark use of the bikeshare service during the weekends for casual riders but no interesting trends were seen for annual members. \n","\n","The insights acquired through our analysis have allowed us to come up with three suggestions that Bicyclistic could incorporate into their marketing strategy to convince casual riders to sign up for annual memberships. \n","1. Based on the total and mean trip durations from the data, casual riders are spending more time using the bikeshare service in general than annual members. Therefore, we could encourage casual riders to sign up for annual memberships if we introduced a point-based incentive program for annual members. This program would allow annual members to earn points based on the duration of the trips that are being taken. To ensure proper use, an app or a bike modification could be implemented to help accurately track the length and distance of the trip. \n","2. Based on the trend of high ridership for casual riders during the months of May to September, we could introduce special promotional offers during this time. Since so many casual riders are using this service, they might be nudged forward or be more inclined to sign up for a membership if there was a promotion. We could consider simple discounts on memberships or offer a membership with special ride passes (i.e. free ride pass for a person taking a trip together with a member).\n","3. Based on the proportion of casual riders that seem to favor using the bikeshare service during the weekend, we could introduce special events for annual members that occur periodically at this time of the week. Social events like gatherings would help the Divvy community of riders come together and interact with other members that may have a common goal. Recreational members could meet up to go for relaxing trips around the city while more athletic members might coordinate training routes.\n","\n","We would recommend further looking into past Divvy trip data to see if these trends and patterns were present during those time periods as well. Additional use of other primary data sources could help affirm the conclusions made in this analysis. Collection of internal data at Bicyclistic, on the same level of precision and accuracy as Divvy, would also be an amazing addition since we would have personal, up-to-date data sets with a large enough sample size to work with. This would support our insights from this analysis and back up the recommendations offered here for the company's future marketing strategy."]}],"metadata":{"kernelspec":{"display_name":"R","language":"R","name":"ir"},"language_info":{"codemirror_mode":"r","file_extension":".r","mimetype":"text/x-r-source","name":"R","pygments_lexer":"r","version":"4.0.5"},"papermill":{"default_parameters":{},"duration":231.185233,"end_time":"2022-09-26T00:49:05.989299","environment_variables":{},"exception":null,"input_path":"__notebook__.ipynb","output_path":"__notebook__.ipynb","parameters":{},"start_time":"2022-09-26T00:45:14.804066","version":"2.3.4"}},"nbformat":4,"nbformat_minor":5}